// HomePage.js
import React from "react";
import Header from "../../components/ui/header/header";
import Footer from "../../components/ui/footer/footer";
import ReportButton from "./table/button/buttonReport";
import FilterComponent from "./table/FilterDashboard/filterButton";

function ReportPage() {
  return (
    <div>
      <Header />
      <ReportButton />
      <FilterComponent />

      <Footer />
    </div>
  );
}

export default ReportPage;
